import React, { useState, useEffect } from "react";
import "./Styles.css";

function Menu() {
  useEffect(() => {
    getData();
  }, []);

  const getData = async () => {
    const data = await fetch("https://www.grubhub.com");

    const items = data.json();
    console.log(items);
  };

  return (
    <div className="centered">
      <h2>our menu</h2>
    </div>
  );
}

export default Menu;
